import React from 'react';
import { ReactDOM } from 'react';


function incomechart() {

   
    var Iframe = React.createClass({     
        render: function() {
          return(         
            <div>          
              <iframe title="Income_Powerbi" width="1140" height="541.25" src="https://app.powerbi.com/reportEmbed?reportId=f135c47d-4c68-45b0-b5ac-48a6af2ca24d&autoAuth=true&ctid=44b16b3e-92d5-4da4-9509-5b979198aded&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly93YWJpLXNvdXRoLWVhc3QtYXNpYS1yZWRpcmVjdC5hbmFseXNpcy53aW5kb3dzLm5ldC8ifQ%3D%3D" frameborder="0" allowFullScreen="true"></iframe>
       
            </div>
          )
        }
      });
      
      ReactDOM(
        <Iframe src="http://plnkr.co/" height="500" width="500"/>,
        document.getElementById('example')
      );
}
export default incomechart;
